import collections

class Solution:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        substr = [] 
        def combs(current, options):
            if not options and current not in substr:
                substr.append(current)
                return
            else:
                for j, w in enumerate(options):
                    pst = current + w
                    if pst in s:
                        tmp = options[:j] + options[(j+1):]
                        combs(pst,tmp)
        combs("", words)
        res = []
        for st in substr:
            s_ = s
            while st in s_:
                res.append(s_.find(st))
                s_ = s_[(res[-1] + 1):]
        return res
    
    def findSubstring2(self, s: str, words: list[str]) -> list[int]:
        counts = collections.Counter(words)
        k = len(s)
        m = len(words[0])
        n = len(words)
        length = m * n
        indices = list()

        for ind in range(k - length + 1):
            substr = s[ind:(ind + length)]
            substr_counts = counts.copy()
            words_used = 0
            for jnd in range(0, length, m):
                part = substr[jnd:(jnd + m)]
                if substr_counts.get(part, -1) > 0:
                    words_used += 1
                    substr_counts[part] -= 1
                else:
                    break

            if words_used == n:
                indices.append(ind)

        return indices
    
